import React from 'react'
import { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { Link } from 'react-router-dom';
import format from 'date-fns/format';


export default function ViewCommessa() {

    const [commessa, setCommessa] = useState([]);
    const { id } = useParams();

    // GET operation with fetch API
    useEffect(() => {
        const fetchCommessa = async () => {
            const response = await fetch(`http://localhost:8080/commessa/${id}`);
            const data = await response.json();
            console.log(data);
            setCommessa(data);
        };
        fetchCommessa();
    }, [id]);

 
  return (
    <div className="container">
        <div className="py-4">
            <table className="table border shadow">
                <thead>
                    <tr>
                    <th scope="col">id</th>
                    <th scope="col">Title</th>
                    <th scope="col">Description</th>
                    <th scope="col">Note</th>
                    <th scope="col">Customer organization id</th>
                    <th scope="col">Customer reference id</th>
                    <th scope="col">Utente id</th>
                    <th scope="col">Creation date and time</th>
                    <th scope="col">Date and time update</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        
                            <tr>
                            <th scope="row" key={commessa.id}>{commessa.id}</th>
                            <td>{commessa.titolo}</td>
                            <td>{commessa.descrizione}</td>
                            <td>{commessa.note}</td>
                            <td>{commessa.idOrganizzazioneCliente}</td>
                            <td>{commessa.idRifCliente}</td>
                            <td>{commessa.idUtente}</td>
                            <td>{commessa.dataOraCreazione}</td>
                            <td>{commessa.dataOraAggiornamento}</td>
                            </tr>
                    }
                </tbody>
            </table>
            
             <Link className="btn btn-primary mx-2" to="/">Back</Link>
                            
        </div>
    </div>
  )
}
